import React from "react";
import { Button, Container, Row } from 'react-bootstrap';
import logo from '../../assest/Logo.png'

const Slider = () => {
    return (
        <Container fluid>
           <Row>
               <Col md={8}>
                   <h1>8888</h1>
               </Col>
               <Col md={4}>
                   <h1>444444</h1>
               </Col>
           </Row>
        </Container>
    );
}

export default Slider;
